import React from 'react';
import {Form} from 'react-bootstrap'
 
function Eventreg() {
    return (
        <div>
            <h3>Create New Event</h3>
    <Form.Label>NAME</Form.Label>
    <Form.Control type="text" placeholder="" />

            
        </div>
    )
}

export default Eventreg
